void MainTask(void) {
  GUI_Init();
  //
  // Check if recommended memory for the sample is available
  //
  if (GUI_ALLOC_GetNumFreeBytes() < RECOMMENDED_MEMORY) {
    GUI_ErrorOut("Not enough memory available."); 
    return;
  }
  while (1) {
    _DrawStripes();
    _DrawPNG_file("C:/Work/emWin/Doc/Training/Samples/BitmapConverter/Toucan_162x150.png"); /* Please change the link to a valid PNG file */
    GUI_Delay(1000);
    _DrawStripes();
    _DrawPNG_mem(_acPNG, sizeof(_acPNG));
    GUI_Delay(1000);
  }
}

